import styled from "styled-components";
import Button from "./Button";

const Item = styled.div`
    font-size: 2em;
    text-align: left;
    margin-top: 1%;
    border: 1px solid;
    border-radius: 10px;
    padding: 1%;
    width: 50%
`

function TodoItem(props) {
    return (
        <Item> {props.text} </Item>
    );
}

export default TodoItem;
